const Header = () => {
    return (
        <header className="appHeader">
            <div className="appLogo">
                <img className="" src="https://www.instagram.com/static/images/web/mobile_nav_type_logo-2x.png/1b47f9d0e595.png" alt="Instagram Logo" />
            </div>
            <div className="appSearch">
                <img className="" src="https://www.instagram.com/static/images/web/mobile_nav_type_logo-2x.png/1b47f9d0e595.png" alt="Instagram Logo" />
            </div>
            <div className="appUserMenu">
                <img className="" src="https://www.instagram.com/static/images/web/mobile_nav_type_logo-2x.png/1b47f9d0e595.png" alt="Instagram Logo" />
            </div>
        </header>
    )
}

export default Header;
